import{scrollToElement}from"./utils.min.js";const onSmoothLinksClick=()=>{const e=document.querySelectorAll('a[href^="#"]:not(a[href="#"]');for(const o of e)o.addEventListener("click",(e=>{e.preventDefault();const t=o.getAttribute("href");scrollToElement(document.querySelector(t))}))};export{onSmoothLinksClick};